import React from 'react';
import Page11 from './components/Page11';
import Page22 from './components/Page22';
import Page33 from './components/Page33';
import Page44 from './components/Page44';
import Page55 from './components/Page55';
import Page66 from './components/Page66';
import Page77 from './components/Page77';
import Homepage from './components/Homepage'
import Categoriespage from './components/Categoriespage'
import Frontpage from './components/Frontpage'
import Navbar from './components/Navbar'
import Page from './components/Page';
import Page1 from './components/pages/Page1';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App () {
  return (  
  <>

    <Router>
    <Routes>
      <Route path="/" element={<Frontpage/>}/>
      <Route path="/categories" element={<Categoriespage/>}/>

    </Routes>

   </Router> 

  </>
  );
}

export default App;
